import React from "react";
import Plot from "react-plotly.js";

function LineChart(props) {
  const {xArr, yArr} = props;

  return (
    <Plot
      data={[
        {
          x: xArr,
          y: yArr,
          type: 'scatter',
        }
      ]}
      layout={{ width: 1000, height: 500, title: "Value by Year Graph" }}
    />
  );
}

export default LineChart;
